import txt from "./IDZero.txt";
import {FetchText} from "../utility/FetchText";
export default  function DataScientist() {
  let IdZero, IdOne, IdTwo, IdThree, IdFour, IdFive, IdSix, IdSeven;
  FetchText(txt);


  return [
    {
      title: "Unknown",
      position: "Notyet",
      description: IdZero,
      profession: "Scientist",
      id: 0
    },
    {
      title: "Albert Einstein",
      position: "Notyet",
      description: IdOne,
      profession: "Physicist",
      id: 1
    },
    {
      title: "Stephen Hawking",
      position: "Notyet",
      description: IdTwo,
      profession: "Physicist",
      id: 2
    },
    {
      title: "Leonhard Euler",
      position: "Notyet",
      description: IdThree,
      profession: "Mathematician",
      id: 3
    },
    {
      title: "Archimedes",
      position: "Notyet",
      description: IdFour,
      profession: "Engineer",
      id: 4
    },
    {
      title: "Galileo Galilei",
      position: "Notyet",
      description: IdFive,
      profession: "Physicist",
      id: 5
    },
    {
      title: "Isaac Newton",
      position: "Notyet",
      description: IdSix,
      profession: "Mathematician",
      id: 6
    },
    {
      title: "Tim Berners-Lee",
      position: "Notyet",
      description: IdSeven,
      profession: "Engineer",
      id: 7
    }
  ];
}

export function profession() {
  return [
    {
      profession: "All",
      id: 0
    },
    {
      profession: "Engineer",
      id: 1
    },
    {
      profession: "Mathematician",
      id: 2
    },
    {
      profession: "Physicist",
      id: 3
    }
  ];
}
